import * as React from 'react';
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

interface Column {
  id:
    | 'id'
    | 'name'
    | 'gender'
    | 'card_number'
    | 'bank_account_no'
    | 'family_card_number'
    | 'marriage_code'
    | 'mother_name'
    | 'pob'
    | 'dob'
    | 'home_address_1'
    | 'home_address_2'
    | 'nc_id'
    | 'contract_start_date'
    | 'first_contract_date'
    | 'secound_contract_date'
    | 'deleted_at'
    | 'department_name'
    | 'type'
    | 'basic_salary'
    | 'position_name'
    | 'operational_allowance_paid'
    | 'meal_allowance_paid'
    | 'meal_allowance'
    | 'grade_name';
  label: string;
  minWidth?: number;
}

const columns: readonly Column[] = [
  { id: 'id', label: 'NIK', minWidth: 95 },
  { id: 'name', label: 'Name', minWidth: 150 },
  { id: 'gender', label: 'Gender', minWidth: 70 },
  { id: 'card_number', label: 'Bank Card No.', minWidth: 130 },
  { id: 'bank_account_no', label: 'Bank Account No.', minWidth: 150 },
  { id: 'family_card_number', label: 'Family Card No.', minWidth: 150 },
  { id: 'marriage_code', label: 'Marriage Status', minWidth: 130 },
  { id: 'mother_name', label: 'Mother Name', minWidth: 150 },
  { id: 'pob', label: 'Place of birth', minWidth: 115 },
  { id: 'dob', label: 'Date of birth', minWidth: 115 },
  { id: 'home_address_1', label: 'Home Address', minWidth: 350 },
  { id: 'home_address_2', label: 'Home Address', minWidth: 350 },
  { id: 'nc_id', label: 'National Card ID No.', minWidth: 170 },
  { id: 'contract_start_date', label: 'Date Start', minWidth: 90 },
  { id: 'first_contract_date', label: 'First Contract', minWidth: 110 },
  { id: 'secound_contract_date', label: 'Secound Contract', minWidth: 130 },
  { id: 'deleted_at', label: 'End Contract', minWidth: 110 },
  { id: 'department_name', label: 'Department', minWidth: 150 },
  { id: 'type', label: 'Employee Type', minWidth: 120 },
  { id: 'basic_salary', label: 'Salary Rp.', minWidth: 90 },
  { id: 'position_name', label: 'Position', minWidth: 150 },
  { id: 'operational_allowance_paid', label: 'O/T Paid', minWidth: 80 },
  { id: 'meal_allowance_paid', label: 'Meal paid', minWidth: 90 },
  { id: 'meal_allowance', label: 'Meal Rp', minWidth: 80 },
  { id: 'grade_name', label: 'Grading', minWidth: 80 },
];

interface Data {
  name: string;
  code: string;
  population: number;
  size: number;
  density: number;
}

function createData(name: string, code: string, population: number, size: number): Data {
  const density = population / size;
  return { name, code, population, size, density };
}

const rows = [
  createData('India', 'IN', 1324171354, 3287263),
  createData('China', 'CN', 1403500365, 9596961),
  createData('Italy', 'IT', 60483973, 301340),
  createData('United States', 'US', 327167434, 9833520),
  createData('Canada', 'CA', 37602103, 9984670),
  createData('Australia', 'AU', 25475400, 7692024),
  createData('Germany', 'DE', 83019200, 357578),
  createData('Ireland', 'IE', 4857000, 70273),
  createData('Mexico', 'MX', 126577691, 1972550),
  createData('Japan', 'JP', 126317000, 377973),
  createData('France', 'FR', 67022000, 640679),
  createData('United Kingdom', 'GB', 67545757, 242495),
  createData('Russia', 'RU', 146793744, 17098246),
  createData('Nigeria', 'NG', 200962417, 923768),
  createData('Brazil', 'BR', 210147125, 8515767),
  createData('Brazil', 'BR', 210147125, 8515767),
  createData('Brazil', 'BR', 210147125, 8515767),
  createData('Brazil', 'BR', 210147125, 8515767),
  createData('Brazil', 'BR', 210147125, 8515767),
  createData('Brazil', 'BR', 210147125, 8515767),
];

export default function Tables() {
  const [page, setPage] = React.useState(0);

  const handleChangePage = (event: unknown, newPage: number) => {
    setPage(newPage);
  };

  return (
    <Paper sx={{ width: '100%', overflow: 'hidden' }}>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell key={column.id} align={column.align} style={{ minWidth: column.minWidth }}>
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                  {columns.map((column) => {
                    const value = row[column.id];
                    return (
                      <TableCell key={column.id} align={column.align}>
                        {column.format && typeof value === 'number' ? column.format(value) : value}
                      </TableCell>
                    );
                  })}
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
}
